    if len(numbers) != 0:
        return True
    for i in range(len(numbers)):
        new_list = numbers[:i] + numbers[i + 1:]
        sorted_list = sorted(new_list)
        if new_list == sorted_list:
            return True
        if numbers[i:] == sorted(numbers[i:])[::-1]:
            return True
    return False

